import React from 'react'
import { NavLink } from 'react-router-dom'
import { connect } from 'react-redux'
import DropDown from './dropDown'
import user from '../../static/icons/user.png'

const SignedInLinks = (props) => {
  const userImage = profile && profile.pictureUrl ? profile.pictureUrl : user
  const id = props.auth.uid
  const { notifications } = props
  return(
    <div>
      <ul className="right nav-links">
        <li className="drop_down-btn">
          <img
            src={userImage}
            className="circle_img"
            alt="dp"
            height="40px"
            width="40px" />
          <DropDown id={id} notifications={notifications} />
        </li>
      </ul>
    </div>
  )
}

const mapStateToProps = (state) => {
  // console.log(state)
  return {
    profile: state.firebase.profile,
    auth: state.firebase.auth,
    notifications: state.firestore.ordered.notifications
  }
}

export default connect(mapStateToProps)(SignedInLinks)
